N = len(raw_sig)
H = np.zeros(N)
l = int(30*1.6)

windowed_sig = moving_window(raw_sig, 30, 1.6, 1 / 30)

for enum, sig in enumerate(windowed_sig):
    sig = np.array(sig)
    sig = np.array([sig[:, i] for i in range(0, 3)])

    # Spatial Averaging
    mean_color = np.mean(sig, axis=1)

    # Temporal normalization
    diag_mean_color = np.diag(mean_color)
    diag_mean_color_inv = np.linalg.inv(diag_mean_color)
    Cn = np.matmul(diag_mean_color_inv, sig)

    # Projection
    S1 = Cn[1] - Cn[2]
    S2 = Cn[1] + Cn[2] - 2 * Cn[0]
    alpha = np.std(S1)/np.std(S2)
    h = S1 + alpha * S2

    # Overlap-Adding
    H[enum:enum + l] = H[enum:enum + l] + (h - np.mean(h))

# FFT to find the maxiumum frequency
# find the segment length, such that we have 8 50% overlapping segments (Matlab's default)
segment_length = (2 * H.shape[0]) // (12 + 1)

# the number of points for FFT should be larger than the segment length ...
